//[MiscUserCode] You can add your own definitions of your custom methods or any other code here...
void PlayInfoComponent::actionListenerCallback (const String& message){

    if (message.equalsIgnoreCase(Events::SONG_START))
    {
        showComponents();
        const Song currentSong = audioPlayer->getCurrentSong();
        songLabel->setText(currentSong.name,dontSendNotification);
        //timeLabel->setText(currentSong.duration,dontSendNotification);
        artistTitle->setText(currentSong.artist,dontSendNotification);
        startTimer (30);
        sliderSongTime->setRange (0, currentSong.length, 1);
        sliderSongTime->setEnabled(true);
    }else if (message.equalsIgnoreCase(Events::SONG_END))
    {
        stopTimer();
    }
    else if (message.equalsIgnoreCase(Events::STOP))
    {
        hideComponents();
    }
}

void PlayInfoComponent::hideComponents(){
    songLabel->setVisible(false);
    artistTitle->setVisible(false);
    //sliderSongTime->setVisible(false);
    sliderSongTime->setValue(999999);
    timeLabel->setVisible(false);
    tangoDJLabel->setVisible(true);
}
void PlayInfoComponent::showComponents(){
    songLabel->setVisible(true);
    artistTitle->setVisible(true);
    //sliderSongTime->setVisible(true);
    timeLabel->setVisible(true);
    tangoDJLabel->setVisible(false);
}
void PlayInfoComponent::timerCallback()
{
    double timeRemaining = audioPlayer->getTimeRemaining();
    const Song currentSong = audioPlayer->getCurrentSong();
    sliderSongTime->setValue(currentSong.length - timeRemaining, dontSendNotification);
    String remain (timeRemaining < 0.0 ? String::empty : "-");
    remain << SongHelper::timeToTimeString (timeRemaining);
    timeLabel->setText(remain,dontSendNotification);
}

